import React from 'react';
import './bootstrap.min.css';
import classes from './Account.module.css' 

export default function social(){
    return(
        <section>
            <header>
                Add Social Links
            </header>
            <hr className='m-2'></hr>
            <div> 
                <li className={`$class`}> Custom URL</li>
            </div>
        </section>
    )
}
